import './App.css';
import Menu from './Menu'
import Equipos from './Equipos'
import Footer from './Footer'
import Inicio from './Inicio'

class para extends React.Component {
 render() {
    const arr = ['Line 1. ', <br />, 'Line 2.'];
    return (
      <p> {arr} </p>
    );
  }
}
function App() {
  return (
    <div className="container pt-5 mt-5">
      <>
    <Menu />
    <Inicio 
    titulo="Historía del Fútbol"
    img="/img/historia.jpeg"  
    descripcion="Bienvenido a Fútbol APP, un sitio web sobre la historia del fútbol que incluye competiciones, equipos y jugadores."
    parrafo="La historia del fútbol El fútbol (o soccer, como se llama el juego en algunas partes del mundo) tiene una larga historia. El fútbol en su forma actual surgió en Inglaterra a mediados del siglo XIX. Sin embargo, existían versiones alternativas del juego mucho antes y forman parte de la historia del fútbol."
/>
    <Equipos 
    nombre="Real Madrid" 
    img="/img/realmadrid.png"
    descripcion="['Line 1', 'Line 2', 'Line 3']" />

    <Equipos 
    nombre="F.C. Barcelona" 
    descripcion="Fútbol Club Barcelona. Es una entidad deportiva de la ciudad de Barcelona, España. Fue fundado como club de fútbol el 29 de noviembre de 1899 por doce jóvenes futbolistas aficionados, liderados por el suizo Hans Gamper. El F. C. Barcelona es conocido popularmente como Barça (abreviación de la pronunciación de «Barcelona» en catalán central) y los seguidores como «culés» (pronunciación del catalán culers)." 
    img="/img/fcbarcelona.png"/>

    <Equipos 
    nombre="Sevilla" 
    descripcion="El Sevilla FC es el club de fútbol decano de la ciudad de Sevilla. Su fundación data del año 1890. El 25 de enero de ese año quedó constituida como asociación privada de carácter cultural y deportivo. Se registró, para adaptarse a la normativa vigente, el 14 de octubre de 1905. Es el club andaluz más exitoso, con 73 temporadas en Primera División y 13 títulos nacionales e internacionales en su haber: una Liga (45/46), cinco Copas (35, 39, 48, 2007 y 2010), seis UEFA Europa League (2006, 2007, 2014, 2015, 2016 y 2020), una Supercopa de Europa (2006) y una Supercopa de España (2007). Asimismo, es el claro dominador de la Copa de Andalucía, torneo de carácter oficial que se disputó desde 1915 hasta 1940, conquistando 18 de las 21 ediciones que se disputaron. Es el único club de Andalucía que ha logrado títulos internacionales y el que más campañas ha disputado en competiciones europeas: un total de 18 temporadas."
    img="/img/sevilla.png"/>

<Footer />

    </>        
    </div>
  );
}

export default App;
ReactDOM.render(<Para />, document.getElementById("para"));
